INSERT INTO `ws_system` VALUES (17,6,'10:00-15:00',1602219717,''),(16,5,'10',1602219696,''),(15,7,'1',1602219688,''),(18,2,'特别提醒：\n\n       任何特殊情况无法签到，一定要在挑战时间内联系客服，非挑战时期内联系客服不会受理，未挑战成功则斑马券会被其他挑战者瓜分.\n\n\n\n      打卡时间： 平台内有多个活动，不同活动的挑战时间和规则都不相同，您可以在参加活动前查看该活动规则。\n\n\n\n      打卡方式： 在每个参加活动的界面内在规定的时间内按点击签到按钮，签到记录会在我的-我 的签到记录里记录，将给你留存签到记录，确保你的每一次签到都能记录在内。\n\n\n\n打卡奖励：每天奖励自动发放。\n\n\n\n提现方式：目前仅支持人工转账，一天处理两次，早上提的中午处理，下午提的晚上处理。晚上提的需第二日处理。\n\n\n\n报备规则：在签到时间内无法签到，请发信息给客服，格式：报备+ID，24小时内客服会根据后台记录确认是否有效。\n\n\n\n报备方式：\n\n微信请联系客服微信号：Playboyljgg     \n微信报备以分为准。\n\nQQ请联系客服QQ号：2895723595     \nQQ报备以秒为准。',1602241070,'斑马挑战'),(19,1,'斑马挑战是斑马习惯的兄弟平台\n斑马挑战客服请联系185520029781，手机号码同微信同QQ号',1602240667,''),(20,2,'特别提醒：任何特殊情况无法签到，一定要在挑战时间内联系客服，非挑战时间内联系客服不会受理，未挑战成功则会被其他挑战者瓜分\n\n打卡时间是几点？平台有多个活动，不同活动，挑战时间和规则不同，您可以在参与活动之前查看该活动规则；\n\n如何确保打卡成功？平台内签到成功，我的-我的签到记录，将给您留存记录，确保您的每一次签到，都给您记录在内。如有疑问请及时联系客服解决问题\n\n参加活动有什么好处？参加活动，每天按时签到领取奖励。\n\n参加活动了可以随时退出吗？参与活动必须按照规则参加活动，活动没有结束无法提前退出\n\n怎么算失败？未能在限定时间内，则视为失败。\n\n奖励如何发放？每天奖励自动发放\n\n极端问题特殊情况无法签到怎么办？如果出现特殊原因必须在挑战时间段内联系客服。\n\n提现有要求吗？\n\n怎么实名？提现与实名一致（微信与支付宝需与实名一致）\n\n提现多久到账？工作日24小时内到账，非工作日顺延至工作日到账。\n\n每天都需要支付挑战金吗？不失败可以一直参与挑战。\n\n挑战金怎么退回？挑战周期结束都可以\n\n工作时间？报备24小时都可以，不需要等客服回复，报备时间符合规则均有效\n\n平台靠谱吗？平台为宜兴市尚嘉雅艺装潢材料有限公司，有关公司电话，联系方式及更多详情，可邮箱337386938@qq.com\n\n',1602241582,'使用协议'),(21,8,'1',1602375917,''),(22,9,'20',1602403738,'');
