  `moneyType` tinyint(1) DEFAULT '0' COMMENT '0-充值 1-打卡 2-房间挑战 3-闯关',
  `isReward` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0-不是 1-是',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `uid-type-isreward` (`uid`,`type`,`isReward`),
  KEY `isReward` (`isReward`)
) ENGINE=MyISAM AUTO_INCREMENT=3416 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='用户金额记录';
